package cn.com.evo.integration.jinanyouxian.common;import cn.com.evo.integration.common.request.AuthRequest;/** * @Description: * @author: lu.xin * @create: 2019-04-09 2:11 PM **/public class JnyxAuthRequest extends AuthRequest {    private String accesstoken;    public static JnyxAuthRequest playAuthInit(String cardNo,                                               String appId, String columnId, String contentId,                                               String childContentId, String accesstoken) {        JnyxAuthRequest request = new JnyxAuthRequest();        request.setCardNo(cardNo);        request.setAppId(appId);        request.setColumnId(columnId);        request.setContentId(contentId);        request.setChildContentId(childContentId);        request.setAccesstoken(accesstoken);        return request;    }    public String getAccesstoken() {        return accesstoken;    }    public void setAccesstoken(String accesstoken) {        this.accesstoken = accesstoken;    }}